import React from 'react'; 

function App() {
    const sayHello = () => {
        console.log("hello");

    }

    

    return (
        <div>
            <head> 
                <style>
                    <h1 style="color: blue">
                        Blue title
</h1> 
                </style>
            </head>
 
            <h1>Hello React</h1>
            <button onClick={sayHello}> Hello</button>
            
    
        </div>
        );
}
export default App;
